import React from "react";
import "./Home.css";

function Home() {
  return (
    <>
      {/* home */}
      <div className="container-fluid home">
        <div className="row">
          {/* home left */}
          <div className="col-lg-6 hidden-xs home_left">
            <img
              className="home_img"
              src="./images/helpng.png"
              alt="no image"
            />
          </div>
          {/* home right */}
          <div className="col-lg-4  col-xs-12 home_right">
            <h3 className="head">
              Never say never <br />
              because limits, like fears, are often just an illusion.
            </h3>
            <button className="btn ">Buy Now</button>
          </div>
        </div>
      </div>
    </>
  );
}

export default Home;
